import Navbar from "./nav";
import "./about.css";
export default function About(){
    return(
        <div className="Aboutus">
            <div className="navabout">
                <Navbar/>
            </div>
            <div className="aboutmid">
                <h1 className="abouttext1">FIND YOUR PERFECT MATCH IN ELITELOVE MATRIMONY</h1>
            </div>
        </div>
    )
}
